import "./cliente.css";

export default function Cliente(props) {
  return (
    <div className="conteudo-lista-cliente">
      <p className="conteudo-lista-cliente-id">{props.id}</p>
      <p className="conteudo-lista-cliente-nome">{props.nome}</p>
      <p className="conteudo-lista-cliente-email">{props.email}</p>
      <p className="conteudo-lista-cliente-telefone">{props.telefone}</p>
    </div>
  );
}
